import React from 'react';
import styled from '@emotion/styled';
import './css/TeslaMegapackStyles.css';

const StyledDiv = styled.div`
  ${props => props.className}
`;

export function TeslaMegapack(props:any) {
    const {noOfBatteries} = props;
    const repeatedComponents = [];

    for (let i = 0; i < noOfBatteries; i++) {
        repeatedComponents.push(<StyledDiv className="tesla-megapack">
        Megapack
    </StyledDiv>);
    }
    return (
        <>
        {repeatedComponents}</>
    );
}

export function Transformer() {
    return (
        <StyledDiv className="tesla-megapack">
            Transformer
        </StyledDiv>
    );
}
